import React, { useEffect } from 'react';

import 'materialize-css/dist/css/materialize.min.css';
import M from 'materialize-css/dist/js/materialize.min.js';
import './App.css';

const App = () => {
  useEffect(() => {
    // Initializes Materialize JS
    M.AutoInit();
  })
  return (
    <div className="App">
      <header className="App-header">
          My App
      </header>
    </div>
  );
}

export default App;
